// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SignupPage from './authentications/signup/SignupPage';
import Login from './authentications/login/Login';
import Dashboard from './dashboard/Dashboard';  // Import Dashboard component
import Home from './Home';

const App = () => {
  return (
      <Router>
        <Routes>
          <Route path="/signup" Component={SignupPage } />
          <Route path="/login" Component={Login } />
          <Route path="/dashboard" Component={Dashboard} />  {/* Add Dashboard route */}
          <Route path="/" Component={Home } />
        </Routes>
      </Router>

  );
};


export default App;
